'use strict';
//@@DocBrief("The class provides access to trading session information.")
class Session {
    sessionId;
    traderId;
    tradingTerminal;
    options;
    getTraderId() {
        return this.traderId;
    }
    getSessionId() {
        return this.sessionId;
    }
    getTradingTerminal() {
        return this.tradingTerminal;
    }
    getOptions() {
        return this.options;
    }
    static create(sessionId, traderId, tradingTerminal, options) {
        let session;
        session = new Session();
        session.sessionId = sessionId;
        session.traderId = traderId;
        session.tradingTerminal = tradingTerminal;
        session.options = options;
        return session;
    }
}
module.exports = Session
